Connectez-vous à la VM Web : ssh azureuser@<IP_PUBLIQUE_WebServerVM> Installez Python et Flask : sudo apt update
sudo apt install python3 python3-pip -y
pip3 install flask requests Créez un serveur Flask pour accéder aux données de la VM Base de Données : nano web_server.py Contenu de web_server.py : import requests
from flask import Flask, jsonify app = Flask(__name__) DB_SERVER_IP = "<IP_PRIVÉE_DBServerVM>" @app.route('/')
def home(): return "Bienvenue sur le serveur web ! Accédez aux utilisateurs via /users" @app.route('/users')
def get_users(): try: response = requests.get(f"http://{DB_SERVER_IP}:5000/users") return jsonify(response.json()) except Exception as e: return jsonify({"error": str(e)}) if __name__ == '__main__': app.run(host='0.0.0.0', port=80) Récupérez l’adresse IP privée de la VM Base de Données : az vm show -d --resource-group GroupeMultiTiers --name DBServerVM --query privateIps -o tsv Remplacez <IP_PRIVÉE_DBServerVM> dans web_server.py avec l’adresse récupérée. Lancez le serveur Flask : sudo python3 web_server.py
